import axios from 'axios'
import React from 'react'
import { useSelector } from 'react-redux'

function DonatorsList() {
    const user = useSelector(state => state.user.userInfo)
    const [donators, setDonators] = React.useState([])
    const [newdonators, setnewDonators] = React.useState([])
    const config = {
        headers: {
            'Content-Type': 'application/json',
            Authorization: `Bearer ${user.token}`
        }
    }
    const donatorsListHandler = async (command) => {
        const { data } = await axios.get('http://127.0.0.1:8000/api/restaurant/donators-list/', config)
        console.log(data)
        setDonators(data)


    }
    for (var i in donators) {
        console.log('Instance' + i)
        console.log(donators[i])
        if (newdonators.length >= 1) {
            for (j in newdonators) {

                if (newdonators[j].username == donators[i].username) {
                    console.log('Instance' + i)
                    console.log(newdonators[i].username)
                    console.log(donators[i].username)
                    console.log('match found')

                } else {
                    // newdonators.push(donators[i])
                    console.log('match not found')
                }
            }
        } else {
            console.log('first instance')
            newdonators.push(donators[i])
        }
    }
    console.log(newdonators)


    React.useEffect(() => {
        donatorsListHandler()
    }, [])
    return (
        <div>
            <h1>DOnaion request</h1>
        </div>
    )
}

export default DonatorsList
